import React from 'react';
import { ScrollView } from 'react-native';
import { globalStyles } from '../../styles';

// Components
import SearchInput from './SearchInput';

function Search() {
	return (
		<ScrollView style={globalStyles.container}>
			<SearchInput />
		</ScrollView>
	);
}

export default Search;
